import React from "react";
import "./CreateResturant.css"
// import { useHistory } from "react-router-dom";


const CreateResturant = () =>{
    return (
        <div className="cover">
            <input type="text" placeholder="Name"/>
            <input type="text" placeholder="Custine Type"/>
            <input type="text" placeholder="Location"/>
            <input type="text" placeholder="Select Image"/>
            <div className="login-btn">Create Restaurant</div>
            

        </div>
    )
}

export default CreateResturant
